import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";

function Cart({ cartItems, onRemove }) {
    return(
        <>
        <Navbar/>
        <div className="Cart">
          <h2>Your Cart</h2>
          {cartItems.length === 0 ? (
            <div className="HeadMo">
              <h1>No Orders!</h1>
            </div>
          ) : (
            <ul>
              {cartItems.map((item) => (
                <li key={item.title}>
                  <div>
                    <strong>{item.title}</strong>: {item.para}
                    <button onClick={() => onRemove(item.title)}>Remove</button>
                  </div>
                </li>
              ))}
            </ul>
          )}
    </div>
        <Footer/>
        </>
    )
}

export default Cart;
